using UnityEngine;

public class Collectable : MonoBehaviour
{
    public GameObject fruit;
    public GameObject animation;
    public AudioClip sound;
    
    private void OnTriggerEnter2D(Collider2D other)
    {
        if (other.CompareTag("Player"))
        {
            fruit.SetActive(false);
            animation.SetActive(true);
            AudioSource.PlayClipAtPoint(sound, transform.position);
            Destroy(other.gameObject);
        }
    }
}

using UnityEngine;

public class Movement : MonoBehaviour
{
    public float moveSpeed = 5f;
    public float jumpForce = 10f;
    private Rigidbody2D rb;

    private bool isGrounded;
    private bool doubleJump;
    
    void Start()
    {
        rb = GetComponent<Rigidbody2D>();
    }

    void Update()
    {
        float moveInput = Input.GetAxis("Horizontal");
        rb.velocity = new Vector2(moveInput * moveSpeed, rb.velocity.y);

        bool canJump = isGrounded;
        bool canDoubleJump = isGrounded == false && doubleJump;

        if (Input.GetKeyDown(KeyCode.Space))
        {
            if (canJump)
            {
                Jump();
            }
            else if (canDoubleJump)
            {
                Jump();
                doubleJump = false;
            }
        }
    }

    private void Jump()
    {
        rb.velocity = new Vector2(rb.velocity.x, jumpForce);
    }

    void OnCollisionEnter2D(Collision2D collision)
    {
        isGrounded = true;
        doubleJump = true;
    }

    void OnCollisionExit2D(Collision2D collision)
    {
        isGrounded = false;
    }
}

/*

Доказательство условия про два ребра:

- inB[v] + inC[v] считаем только по "живым" годам.
 
- Замечание: когда алгоритм закончился, для любой вершины
inB[v] == 1 и inC[v] == 1.
 
- Действительно, исходящих рёбер каждого цвета ровно |V|,
а условие задачи требует ≥1 входа каждого цвета;
 
- поэтому два входа одного цвета в одну вершину невозможны.
*/


/*************************************************************
 *  Для каждого года i есть два ориентированных ребра
 *      Ai ──(blue)──► Bi
 *      Ai ──(red) ─► Ci
 *
 *  Оставляем подмножество лет  S.  Требование условия:
 *
 *  в каждую вершину входит ≥ 1 blue-и ≥ 1 red-ребро.
 *  Поэтому в корректном ответе в вершину не может
 *  входить два ребра одного цвета – иначе какой-то
 *  вершине не хватило бы входов (принцип Дирихле).
 *
 *  Алгоритм “листопад”.
 *  ------------------------------------
 *  • inB[v], inC[v] –- число blue/red входов из ещё
 *    «живых» лет;
 *  • occCnt[v] – число «живых» лет,
 *    где v встречается в A,B или C.
 *  • Очередь Q из вершин, у которых  inB==0 || inC==0.
 *  • Пока Q не пуста:
 *        v = pop()
 *        если  occCnt[v] == 0     continue
 *        для каждого года idx, где v встречается
 *            if removed[idx]      continue
 *            removed[idx] = true
 *            --occCnt[ Aidx ], occCnt[ Bidx ], occCnt[ Cidx ]
 *            --inB[ Bidx ],  --inC[ Cidx ];
 *            если какая-то вершина осталась без входа
 *            ⇒ push в очередь
 *  ответ = удаленные года. 
 *  Работает O(N) памяти/времени:
 *  каждый год и вершина обрабатываются максимум один раз.
 *************************************************************/

#include <bits/stdc++.h>
using namespace std;

struct Triple { int a, b, c; };

int main() {
    ios::sync_with_stdio(false);
    cin.tie(nullptr);

    int N;
    if (!(cin >> N)) return 0;

    vector<Triple> yr(N);
    for (int i = 0; i < N; ++i) cin >> yr[i].a;
    for (int i = 0; i < N; ++i) cin >> yr[i].b;
    for (int i = 0; i < N; ++i) cin >> yr[i].c;

    const int SZ = N + 1;                 // вершины 1..N
    vector<int> inB(SZ, 0), inC(SZ, 0), occCnt(SZ, 0);
    vector<vector<int>> occ(SZ);          // годы, где встречается вершина

    // собираем "статистику"
    for (int i = 0; i < N; ++i) {
        auto [a,b,c] = yr[i];
        ++inB[b]; ++inC[c];
        for (int v : {a,b,c}) {
            ++occCnt[v];
            occ[v].push_back(i);
        }
    }

    queue<int> Q;
    vector<char> inQ(SZ, 0);
    auto push_if_bad = [&](int v) {
        if (occCnt[v] && (inB[v]==0 || inC[v]==0) && !inQ[v]) {
            Q.push(v); inQ[v] = 1;
        }
    };
    for (int v = 1; v <= N; ++v) push_if_bad(v);

    vector<char> removedYr(N, 0);
    int removedCnt = 0;

    while (!Q.empty()) {
        int v = Q.front(); Q.pop(); inQ[v] = 0;
        if (occCnt[v]==0) continue;          
        // могла обнулиться раньше

        for (int idx : occ[v]) {
            if (removedYr[idx]) continue;
            removedYr[idx] = 1;
            ++removedCnt;

            auto [a,b,c] = yr[idx];

            // убрали год – вершины в нём проявляются на год меньше */
            for (int u : {a,b,c}) {
                if (--occCnt[u]==0) inQ[u]=0;   
                // совсем исчезла
            }

            // у целей ушёл вход
            if (--inB[b]==0) push_if_bad(b);
            if (--inC[c]==0) push_if_bad(c);
        }
    }

    cout << removedCnt << '\n';
    return 0;
}

/*
 * Вход:
 *   n                        — количество вершин (0 … n-1)
 *   затем n строк:           — описание каждой вершины
 *     <буква>  <left> <right>
 *       буква  – символ 'A' … 'Z' в самой вершине
 *       left   – индекс левого ребёнка или −1
 *       right  – индекс правого ребёнка или −1
 *
 * Корень – та вершина, которая нигде не встречается как чайлд.
 */

/*
7
A 1 2
B 3 4
C 5 6
D -1 -1
E -1 -1
F -1 -1
E -1 -1 
*/

#include <bits/stdc++.h> 
// Так вызываются все стандартные библиотеки
using namespace std;

struct Node {
    char c;     // буква
    int  left;  // индекс левого чайлда или -1
    int  right; // индекс правого чайлда или -1
};

// информация, которую храним в хэше для каждой маски
struct Info {
    int idx;   // вершина
    int size;  // размер поддерева
};

vector<Node> tree;                       // сами вершины
unordered_map<uint32_t, Info> seenMask;  // mask → лучшая вершина
pair<int,int> firstPair{-1,-1};          // ответ на «лёгкую» версию
pair<int,int> bestPair{-1,-1};           // ответ на «сложную» версию
int bestSum = -1;                        // максимум size(u)+size(v)

/* DFS возвращает:
 *   mask  — 26-битная маска букв поддерева
 *   size  — количество вершин поддерева
 */
pair<uint32_t,int> dfs(int v)
{
    if (v == -1) return {0u, 0};

    auto [mL, sL] = dfs(tree[v].left);
    auto [mR, sR] = dfs(tree[v].right);

    uint32_t myMask = mL | mR | (1u << (tree[v].c - 'A'));
    int      mySize = sL + sR + 1;

    auto it = seenMask.find(myMask);

    // первая пара дублей → ответ «лёгкой» задачи
    if (it != seenMask.end() && firstPair.first == -1)
        firstPair = {it->second.idx, v};

    // обновляем максимум для «сложной» версии
    if (it != seenMask.end()) {
        int curSum = it->second.size + mySize;
        if (curSum > bestSum) {
            bestSum = curSum;
            bestPair = {it->second.idx, v};
        }
        // в таблице оставляем вершину с бОльшим поддеревом —
        // это для следующих сравнений
        if (mySize > it->second.size)
            it->second = {v, mySize};
    } else {
        seenMask.emplace(myMask, Info{v, mySize});
    }

    return {myMask, mySize};
}

int main()
{
    ios::sync_with_stdio(false);
    cin.tie(nullptr);

    int n;
    if (!(cin >> n)) return 0;

    tree.resize(n);
    for (int i = 0; i < n; ++i) {
        char ch; int l, r;
        cin >> ch >> l >> r;
        tree[i] = {ch, l, r};
    }

    /* определяем корень: тот, 
    кто не является ничьим чайлдом */
    vector<int> isChild(n, 0);
    for (auto &v : tree) {
        if (v.left  != -1) isChild[v.left]  = 1;
        if (v.right != -1) isChild[v.right] = 1;
    }
    int root = find(isChild.begin(), isChild.end(), 0) - isChild.begin();
    if (root == n) { cerr << "root not found\n"; return 0; }

    dfs(root);

    if (firstPair.first == -1)
        cout << "No equivalent vertices\n";
    else {
        cout << "Easy version pair: "  << firstPair.first << ' ' << firstPair.second << '\n';
        cout << "Hard version pair: "  << bestPair.first  << ' ' << bestPair.second
             << " (sum = " << bestSum << ")\n";
    }
    return 0;
}

#include <bits/stdc++.h>
using namespace std;
#define ll long long
typedef struct node
{
    int value;
    struct node *next;
} node_t;
node_t *head;
node_t *target;
void printList(node_t *head)
{
    node_t *temporary;
    temporary = head;

    while (temporary != NULL && temporary->value != INT_MAX)
    {
        printf("%d - ", temporary->value);
        temporary = temporary->next;
    }
}
void insertLinkedList(int temp)
{
    // printf("hello \n");
    target->value = temp;
    node_t *newNode;
    newNode = (node_t *)malloc(sizeof(node_t));
    target->next = newNode;
    target = newNode;
    // printf("hello 2 ");
}
int main()
{
    node_t *first;
    first = (node_t *)malloc(sizeof(node_t));
    head = first;
    target = first;
    // cout << head->next << endl;
    insertLinkedList(5);
    insertLinkedList(4);
    insertLinkedList(3);
    insertLinkedList(2);
    target->value = INT_MAX;
    target->next = NULL;
    target = NULL;
    printList(head);
}

